    welcome=<div>
    <h1>Looks like you're new around here</h1>
    <h2>Lets get you signed up</h2>
    <h2>We'll start with a name</h2>
        <form onSubmit={this.handleName}>
            <input type="text" onChange={(e)=>{this.setState({name:e.target.value})}}></input>
            <button>That's my name</button>
        </form>
    </div>

    //Qustion 1 (sex)
    question1 = <div>
        <h1>That's a great name user</h1>
    </div>


    changeHandler=(e)=>{
        e.preventDefault();
